import React from 'react';
import './header.css'

function header() {
    return (
        <div className="header">

            <Link to={'/'} className="nav-link"> home</Link>
            <Link to={'/signIn'} className="nav-link"> in</Link>
            <Link to={'/signUp'} className="nav-link">up</Link>
        </div>
    )
}

export default header
